  <title>ANN: Trip</title>
  <script>
    $(document).ready(function () {
      var $menuItems = $('.pointing.menu .item');
      $menuItems.on('click', function () {
        $(this).addClass('active').closest('.ui.menu')
          .find('.item').not($(this)).removeClass('active');

        var segmentId = '#segment_' + this.id.replace('menu_', '');
        $('html,body').animate({ scrollTop: $(segmentId).offset().top}, 'slow');
      });
    });

    function initMap() {

      var latlong = {lat: 13.727092, lng: 100.541126};

      // Create a map object and specify the DOM element for display.
      var map = new google.maps.Map(document.getElementById('map'), {
        center: latlong,
        scrollwheel: false,
        zoom: 11
      });

      var path = new google.maps.Polyline({
        path: window.tripPath,
        geodesic: true,
        strokeColor: '#FF0000',
        strokeOpacity: 1.0,
        strokeWeight: 4
      });
      path.setMap(map);
    }

  </script>
  <script src="https://maps.googleapis.com/maps/api/js?key=AIzaSyD1LE2hiQB2refszSwmTFDDO59bZRUgZic&callback=initMap" async defer></script>
